const Daan_Branding_Admin={init:function(){this.general()},general:function(){var file_frame;window.formfield="";jQuery(document.body).on("click",".edd_settings_upload_button",function(e){e.preventDefault();const button=jQuery(this);window.formfield=jQuery(button.data("input"));if(file_frame){file_frame.open();return}file_frame=wp.media.frames.file_frame=wp.media({title:button.data("uploader_title"),library:{type:"image"},button:{text:button.data("uploader_button_text")},multiple:false});file_frame.on("menu:render:default",function(view){const views={};view.unset("library-separator");view.unset("gallery");view.unset("featured-image");view.unset("embed");view.unset("playlist");view.unset("video-playlist");view.set(views)});file_frame.on("select",function(){const selection=file_frame.state().get("selection");selection.each(function(attachment,index){attachment=attachment.toJSON();window.formfield.val(attachment.url)})});file_frame.open()})}};jQuery(document).ready(function($){Daan_Branding_Admin.init()});